import React from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Logo from '../Logo/Logo'
import { BiUser } from 'react-icons/bi';
import { VscHome } from 'react-icons/vsc';
import { Link } from 'react-router-dom'

const Navbar1 = () => {
    return (
        // <Nav activeKey="/Profile" className='nav-bar'>
        //     <Nav.Item>
        //         <Link to="/Profile" className='nav-link'>Active</Link>
        //     </Nav.Item>
        //     <Nav.Item>
        //         <Link to="/Profile" className='nav-link'>Active</Link>
        //     </Nav.Item>
        //     <Nav.Item>
        //         <Link to="/Profile" className='nav-link'>Active</Link>
        //     </Nav.Item>
        //     <Nav.Item>
        //         <Link to="/Profile" className='nav-link'>Active</Link>
        //     </Nav.Item>
        //     <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        //         <NavDropdown.Divider />
        //         <NavDropdown.Item href="#action/3.4">Deconnexion</NavDropdown.Item>
        //     </NavDropdown>
        // </Nav>
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand href="#home"><Logo width='150' /></Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link to="#features"><VscHome/>Acceuil</Nav.Link>
                    <Nav.Link href="#pricing"><BiUser/>Profil</Nav.Link>
                </Nav>
                <Nav>
                    <Nav.Link href="#deets">More deets</Nav.Link>
                    <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="#action/3.1">Deconnexion</NavDropdown.Item>
                    </NavDropdown>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
}

export default Navbar1
